import React, {useState} from "react";
import { ExpenseItem } from "./ExpenseItem";
import ExpenseFilter from "./ExpenseFilter";

export function Expenses({ items }) {
  const [initYear, setInitYear] = useState("");
  const [yearSelected, setYearSelected] = useState('')

  const saveDataExpenseFilter = (data)=> {
    const dataFilter = data;
    setInitYear(dataFilter);
    setYearSelected(dataFilter);
  }

  return (
    <>
      <ExpenseFilter saveDataExpenseFilter={saveDataExpenseFilter} initYear={initYear}/>
      {}
      {items.map( (el)=>{
        return (<ExpenseItem key={el.id} item={el}/>)
      })}
    </>
  );
}
